import React from "react";
import Qualitie from "./qualitie";
import BookMark from "./bookmark";


const User = (user) => {
    return (
        <>
            <tr>
                <td scope="col">{user.name}</td>
                <td scope="col">{user.qualities.map(item => Qualitie(item))}</td>
                <td scope="col">{user.profession.name}</td>
                <td scope="col">{user.completedMeetings}</td>
                <td scope="col">{user.rate} / 5</td>

                <td scope="col">
                    <button className="bi bi-bookmark"
                            onClick={()=>user.onClick(user._id)}
                    ></button>
                </td>

                <td scope="col">
                    <button className="btn btn-danger"
                            onClick={()=>user.onClick(user._id).BookMark()}

                    >Delete</button>
                </td>
            </tr>
        </>
    )
}

export default User;
